CREATE FUNCTION public.get_candidatos() RETURNS TABLE(id integer, id_solicitud integer, nombres character varying, apellido_paterno character varying, apellido_materno character varying, tipo_documento integer, numero_documento character, disponibilidad integer, disponibilidad_des character varying, email character varying, file_cv character varying, observaciones character varying, fecha_registro date, usuario_registro character varying, fecha_modificacion date, usuario_modificacion character varying, estado integer, estado_des character varying, id_sede_entrevista integer, contacto_sede character, fecha_entrevista timestamp without time zone, prioridad integer, codigo_posicion character, codigo_trabajo text, genero integer, talla_1 text, talla_1_des character varying, talla_2 text, talla_2_des character varying, talla_3 text, talla_3_des character varying, email_corp character)
    LANGUAGE plpgsql
    AS $$
DECLARE 
	estado_des_1 varchar(100) :='Activo';
	estado_des_2 varchar(100) :='Inactivo';
	BEGIN
		RETURN QUERY
			select sc.id,sc.id_solicitud,sc.nombres,sc.apellido_paterno,sc.apellido_materno,sc.tipo_documento,sc.numero_documento,sc.disponibilidad,dis.descripcion as disponibilidad_des, 
			sc.email,sc.file_cv,sc.observaciones,sc.fecha_registro,sc.usuario_registro,sc.fecha_modificacion,sc.usuario_modificacion,sc.estado, 
			CASE 
			WHEN sc.estado=0 THEN estado_des_1 --'Activo'
			WHEN sc.estado=1 THEN estado_des_2 --'Inactivo'
			END as estado_des, 
			sc.id_sede_entrevista,sc.contacto_sede,sc.fecha_entrevista,sc.prioridad,sc.codigo_posicion, 
			rtrim(sc.codigo_trabajo) as codigo_trabajo, 
			sc.genero as genero,
			rtrim(sc.talla_1) as talla_1,
			cal.descripcion as talla_1_des,
			rtrim(sc.talla_2) as talla_2,
			pan.descripcion as talla_2_des,
			rtrim(sc.talla_3) as talla_3, 
			calz.descripcion as talla_3_des,
			sc.email_corp as email_corp
			from solicitud_candidato as sc
			left join general as cal on cal.grupo='TALLA_CASACAS' and CAST(rtrim(sc.talla_1) AS INT)=cal.codigo
			left join general as pan on pan.grupo='TALLA_PANTALONES' and CAST(rtrim(sc.talla_1) AS INT)=pan.codigo
			left join general as calz on calz.grupo='TALLA_CALZADO' and CAST(rtrim(sc.talla_1) AS INT)=calz.codigo
			inner join general as dis on dis.grupo='DISPONIBILIDAD' and sc.disponibilidad=dis.codigo
			;
	END;
$$;


