CREATE FUNCTION public.get_menu_permiso(user_permiso character varying) RETURNS TABLE(id integer, collapse boolean, name character varying, icon character varying, state character varying, path character varying, component character varying, layout character varying, nivel integer, parent integer, orden integer, estado boolean)
    LANGUAGE plpgsql
    AS $$
BEGIN
	RETURN QUERY
	SELECT 
		me.id,
		me.collapse,
		me.name,
		me.icon,
		me.state,
		me.path,
		me.component,
		me.layout,
		me.nivel,
		me.parent,
		me.orden,
		me.estado
	FROM persona_rol AS pr
