arying, codigo_centro_coste character, centro_coste character varying, codigo_funcion character, funcion character varying, codigo_ocupacion character, ocupacion character varying, codigo_unidad_org character, unidad_organizativa character varying, fecha_nac date, inicio_contrata date, fin_contrata date, cod_jefe character, saldo_dias_vacaion character, saldo_dias_descanso character, categoria character varying, id_jefe integer, codigo_jefe_dir integer, dni_jefe character, nombre_jefe character varying, apellido_paterno_jefe character varying, apellido_materno_jefe character varying, email_corp_jefe character varying, email_personal_jefe character varying, codigo_posicion_jefe character, descripcion_posicion_jefe character varying, codigo_centro_coste_jefe character, centro_coste_jefe character varying, codigo_funcion_jefe character, funcion_jefe character varying, codigo_ocupacion_jefe character, ocupacion_jefe character varying, codigo_unidad_org_jefe character, unidad_organizativa_jefe character varying, fecha_nac_jefe date, inicio_contrata_jefe date, fin_contrata_jefe date, cod_jefe_jefe character, saldo_dias_vacaion_jefe character, saldo_dias_descanso_jefe character, categoria_jede character varying, id_gestor integer, codigo_gestor integer, dni_gestor character, nombre_gestor character varying, apellido_paterno_gestor character varying, apellido_materno_gestor character varying, email_corp_gestor character varying, email_personal_gestor character varying, codigo_posicion_gestor character, descripcion_posicion_gestor character varying, codigo_centro_coste_gestor character, centro_coste_gestor character varying, codigo_funcion_gestor character, funcion_gestor character varying, codigo_ocupacion_gestor character, ocupacion_gestor character varying, codigo_unidad_org_gestor character, unidad_organizativa_gestor character varying, fecha_nac_gestor date, inicio_contrata_gestor date, fin_contrata_gestor date, cod_jefe_gestor character, saldo_dias_vacaion_gestor character, saldo_dias_descanso_gestor character, categoria_gestor character varying, sede_id integer, sede_descripcion character, sede_direccion character, puesto_id integer, grupo_puesto character varying, puesto_des character varying, puesto_detalle character varying, modalidad_id integer, modalidad_grupo character varying, modalidad_des character varying, modalidad_detalle character varying, plazo_id integer, plazo_grupo character varying, plazo_des character varying, plazo_detalle character varying, cantidad_candidato bigint, nombre_ficha_ingreso character varying, ficha_ingreso_des character varying, fecha_aprobacion_gerente timestamp without time zone, fecha_aprobacion_gertor timestamp without time zone)
    LANGUAGE plpgsql
    AS $$
BEGIN
	RETURN QUERY
		SELECT
			sol.id,sol.id_aprobador,sol.id_jefe_directo,sol.id_puesto,sol.cantidad,sol.id_modalidad,
