CREATE FUNCTION public.post_solicitud(id_aprobador integer, id_jefe_directo integer, id_gerente integer, id_puesto integer, cantidad integer, id_modalidad integer, fecha_estimada_inicio date, id_plazo integer, nombre_cliente character, descripcion_servicio character, volumen_motivo character, inicio_estimado_tiempo date, estimacion_duracion_tiempo character, observaciones character, descripcion character, usuario_registro character, estado integer, cantidad_plazo character varying, id_grupo integer[], id_grupo_tipo text[]) RETURNS public.e_return
    LANGUAGE plpgsql
    AS $$
DECLARE
	s_id integer;
	e_return e_return;
	BEGIN
		IF inicio_estimado_tiempo<>null THEN
			inicio_estimado_tiempo=now();
		END IF;
			id_plazo,nombre_cliente,descripcion_servicio,volumen_motivo,inicio_estimado_tiempo,estimacion_duracion_tiempo, 
			observaciones, descripcion,fecha_registro,usuario_registro,estado,cantidad_plazo
		)values(
			id_aprobador,id_jefe_directo,id_gerente,id_puesto,cantidad,id_modalidad,fecha_estimada_inicio,id_plazo,nombre_cliente,
			descripcion_servicio,volumen_motivo,inicio_estimado_tiempo,estimacion_duracion_tiempo,observaciones,descripcion,now(),usuario_registro, estado,cantidad_plazo
		)
		returning id into s_id;
		SELECT	s_id,unnest(id_grupo),unnest(id_grupo_tipo),'', now(),usuario_registro,true;
		e_return.id = s_id;
		e_return.text = concat('Se registr√≥ la solicitud N¬∞ ',s_id);
