--

CREATE FUNCTION public.post_solicitud_baja(p_id_trabajador integer, p_id_jefe integer, p_tipo_baja integer, p_tipo_cese_formal integer, p_tipo_cese_real character, p_fecha_cese date, p_fecha_notificacion date, p_fecha_carta date, p_observaciones character, p_email character, p_usuario_registro character, p_hora_notificacion time without time zone, p_estado integer) RETURNS public.e_return
    LANGUAGE plpgsql
    AS $$
declare 
	p_id integer;
	e_return e_return;
	p_estado_sol integer:=1;
	
	begin
		IF p_tipo_baja=1 THEN
			p_estado_sol=4;
		END IF;
			fecha_cese, fecha_notificacion, fecha_carta, observaciones,fecha_registro,estado,email,usuario_registro,hora_notificacion
									  )
			values(p_id_trabajador, p_id_jefe, p_tipo_baja, p_tipo_cese_formal, p_tipo_cese_real, p_fecha_cese, 
			p_fecha_notificacion, p_fecha_carta, p_observaciones, now(),p_estado_sol,p_email,p_usuario_registro,p_hora_notificacion
				  )
			returning id into p_id;
			
			IF p_tipo_baja=1 THEN
				update solicitud_candidato set estado=3 where id=p_id_trabajador;
				e_return.text = concat('Candidato N¬∞ ', p_id_trabajador , ', anulado correctamente, con solicitud baja N¬∞ ', p_id );
			ELSE
				e_return.text = concat('Se registr√≥ la solicitud de baja N¬∞ ', p_id);
			END IF;
			e_return.id = p_id;
			
			e_return.code = 'S';
	return e_return;

	END;

$$;


